import React, { useState } from "react";
import Nav from "../Component/TopsNav";
import "./List.scss";

function List() {
  let [cold, setcold] = useState([
    {
      name: "토피 넛 콜드 브루",
    },
    {
      name: "나이트로 바닐라 크림",
    },
    {
      name: "나이트로 콜드 브루",
    },
    {
      name: "돌체 콜드 브루",
    },
    {
      name: "바닐라 크림 콜드 브루",
    },
    {
      name: "벨벳 다크 모카 나이트로",
    },
    {
      name: "시그니처 더 블랙 콜드 브루",
    },
    {
      name: "제주 비자림 콜드 브루",
    },
    {
      name: "콜드 브루",
    },
    {
      name: "콜드 브루 몰트",
    },
    {
      name: "콜드 브루 오트 라떼",
    },
    {
      name: "콜드 브루 플로트",
    },
    {
      name: "프렌치 애플 타르트 나이트로",
    },
  ]);

  return (
    <>
      <Nav />
      <div className="List">
        <div className="list-items">
          <div className="title">
            콜드 브루 커피
            <img src="./images/cup.png" alt="컵이미지" />
            <span>디카페인 에스프레소 샷 추가 가능 (일부 음료 제외)</span>
          </div>
          <div className="상품들"></div>
          {cold.map((e, i) => {
            return <CoffeeCard name={e} index={i} />;
          })}
        </div>
        <div className="list-items">
          <div className="title">
            에스프레소
            <img src="./images/cup.png" alt="컵이미지" />
            <span>디카페인 에스프레소 샷 추가 가능 (일부 음료 제외)</span>
          </div>
          <div className="상품들"></div>
        </div>
      </div>
    </>
  );
}

function CoffeeCard(props) {
  return <h4 key={props.index}>{props.name}</h4>;
}

export default List;
